INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (1,'john','cena','male','american','actor',1977,'John Felix Anthony Cena is an American professional wrestler, actor, and former rapper. He is currently signed to WWE. Widely regarded as one of the greatest professional wrestlers of all time, he is tied with Ric Flair for the most world championship reigns in professional wrestling history.','c852fc7a-ff9a-445a-9674-29c81de08f98/john_cena.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (2,'tom','cruise','male','american','actor',1962,'Thomas Cruise Mapother IV is an American actor and producer. One of the world\'s highest-paid actors, he has received various accolades, including an Honorary Palme d\'Or and three Golden Globe Awards, in addition to nominations for three Academy Awards.','e90ce185-de92-4bd5-9400-4c7465a3e3b5/tom_cruise.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (3,'chris','evans','male','american','actor',1981,'Christopher Robert Evans is an American actor. He began his career with roles in television series, such as in Opposite Sex in 2000.','ae8794e4-325e-4918-8fac-5d8c41eec2b3/chris_evans.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (4,'margott','robbie','female','australian','actor',1990,'Margot Elise Robbie is an Australian actress and producer. Known for her roles in both blockbusters and independent films, she has received several accolades, including nominations for two Academy Awards, three Golden Globe Awards, and five British Academy Film Awards.','423ba7ff-280c-4b15-ab48-16380e0be1c4/margot_robbie.jpeg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (5,'chris','hemsworth','male','australian','actor',1983,'Christopher Hemsworth AM is an Australian actor. He rose to prominence playing Kim Hyde in the Australian television series Home and Away before beginning a film career in Hollywood.','bb851720-608b-40fa-bbdd-e31b2d39b646/chris_hemsworth.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (6,'elizabeth','olsen','female','american','actor',1989,'Elizabeth Chase Olsen is an American actress. Born in Sherman Oaks, California, Olsen began acting at age four.','956f56ad-5791-4de5-9d06-2342aee595f2/elizabeth_olsen.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (7,'robert','downey','male','american','actor',1965,'Robert John Downey Jr. is an American actor and producer. His career has been characterized by critical and popular success in his youth, followed by a period of substance abuse and legal troubles, before a resurgence of commercial success later in his career.','8e836b1c-5f33-48e6-bcc0-48efe8a1537f/robert_downey.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (8,'andrew','garfield','male','american-british','actor',1983,'Andrew Russell Garfield is an English and American actor. He has received various accolades, including a Tony Award, a BAFTA TV Award and a Golden Globe Award. Time included Garfield on its list of 100 most influential people in the world in 2022.','5eab0ec4-a3ce-4d42-95b7-3cb2ec2afb73/andrew_garfield.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (9,'tom','holland','male','british','actor',1996,'Thomas Stanley Holland is an English actor. His accolades include a British Academy Film Award, three Saturn Awards, a Guinness World Record and an appearance on the Forbes 30 Under 30 Europe list. Some publications have called him one of the most popular actors of his generation.','8f03368b-0d6b-4015-9fe0-64a1299725d9/tom_holland.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (10,'scarlett','johansson','female','american','actor',1984,'Scarlett Ingrid Johansson is an American actress. The world\'s highest-paid actress in 2018 and 2019, she has featured multiple times on the Forbes Celebrity 100 list. Time magazine named her one of the 100 most influential people in the world in 2021.','c974d8fe-7211-4759-8947-afb112b14b24/scarlettjohansson.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (11,'matt','damon','male','american','actor',1970,'Matthew Paige Damon is an American actor, film producer, and screenwriter. Ranked among Forbes\' most bankable stars, the films in which he has appeared have collectively earned over $3.88 billion at the North American box office, making him one of the highest-grossing actors of all time.','2ca42477-c27a-4618-bc8f-2b36e849fb09/matt_damon.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (12,'emma','stone','female','american','actor',1988,'Emily Jean Stone, known as Emma Stone, is an American actress. She is the recipient of various accolades, including an Academy Award, a British Academy Film Award, and a Golden Globe Award.','016dc5f6-b3bf-4327-aaba-3f34b59394ea/emma_stone.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (13,'christian','bale','male','british','actor',1974,'Christian Charles Philip Bale is an English actor. Known for his versatility and physical transformations for his roles, he has been a leading man in films of several genres. He has received various accolades, including an Academy Award and two Golden Globe Awards.','f8e06e22-8091-4605-8b09-1aa022a5867d/christian_bale.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (14,'christopher','nolan','male','american-british','director',1970,'Christopher Nolan CBE is a British-American film director, producer, and screenwriter. His films have grossed more than US$5 billion worldwide and have garnered 11 Academy Awards from 36 nominations. Born and raised in London, Nolan developed an interest in filmmaking from a young age.','8b98053f-2925-47c5-9909-db3594c17920/christopher_nolan.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (15,'joss','whedon','male','american','director',1964,'Joseph Hill Whedon is an American filmmaker, composer, and comic book writer.','78acd415-08d2-40c4-923a-b5e9e4015d6a/joss_whedon.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (16,'zack','snyder','male','american','director',1966,'Zachary Edward Snyder is an American film director, producer, screenwriter, and cinematographer. He made his feature film debut in 2004 with Dawn of the Dead, a remake of the 1978 horror film of the same name.','450228aa-7285-45fc-839a-b378db80c4e0/zack_snyder.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (17,'anthony','russo','male','american','director',1970,'Anthony J. Russo is an American filmmaker and producer who works alongside his brother Joseph Russo.','33710e41-f445-4d21-ad67-a401c998a5b1/anthony_russo.jpg');
INSERT INTO `` (`id`,`first_name`,`last_name`,`gender`,`nationality`,`known_for`,`birth_year`,`bio`,`image_link`) VALUES (18,'james','gunn','male','american','director',1966,'James Francis Gunn, Jr. is an American filmmaker and actor. He began his career as a screenwriter in the mid-1990s.','4670a961-7d01-4981-bac6-55edd657fa4e/james_gunn.jpg');
